import React, { Component } from 'react'

export default class Service extends Component {
  render() {
    return (
      <div>
        <form>
          <fieldset>
          <legend>Fill Information</legend>
          <label>Name</label><input type={"text"} />
          </fieldset>
        </form>
      </div>
    )
  }
}
